import React, { useState, useEffect } from "react"
import "./cardgame.css"
import axios from "axios"
const framewords = [
  "angular2",
  "vue",
  "react",
  "grunt",
  "phantomjs",
  "ember",
  "babel",
  "ionic",
  "gulp",
  "meteor",
  "yeoman",
  "yarn",
  "nodejs",
  "bower",
  "browserify"
]
const cards = [
  {
    img: "./img/vue.svg",
    name: "vue"
  },
  {
    img: "./img/angular.svg",
    name: "angular"
  }
]
function Card(props) {
  let imag = props.img
  return (
    <div>
      hi
      <img
        src={
          "https://raw.githubusercontent.com/samiheikki/javascript-guessing-game/master/static/logos/" +
          props.name +
          ".png"
        }
      />
      <img class="frontFace" src={require("./img/js-badge.svg")}></img>
    </div>
  )
}
function Cards() {
  return (
    <div>
      {cards.map((card) => (
        <Card {...card} />
      ))}
    </div>
  )
}
function MemoGame() {
  return (
    <div>
      <Cards />
    </div>
  )
}
export default Cards

